  \"2016-03-21T21:28:32.807537\",\n\t\"name\": \"hood-canal-steelhead-hood-canal-steelhead-supplementation-experiment\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Hood Canal Steelhead Project is a 17-year
  before-after-control-impact experiment that tests the effects of supplementation
  on natural steelhead populations in Hood Canal.  There are three supplemented and
  four control (non-supplemented) populations that are being monitored for adult and
  juvenile abundance, life history, and genetic diversity. The project also quantifies
  early marine survival and behavior and ecological interactions between hatchery-
  and natural-origin steelhead.nnProject data.\",\n\t\"license_title\": null,\n\t\"extras\":
